function App() {
  return (
    <BrowserRouter>
      <Routes>


         <Route path="/emailConfirmation" element={<EmailConfirmation />}/>

        <Route path="/" element={<LoginSignUp />}/>
        <Route path ="/MainLayout" element={<MainLayout />}>
          {routes}
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
